		"text": "@kjhaxton I think a lot of this is down to induction. HE is very different to school/college &amp; we need to equip students to explore &amp; experiment. No one ever really tells them how to read, take notes or learn in HE. We don't need to tell them - but we do need to help them explore #LTHEchat"
